import React from "react";
function ListItem(prps) {
  return (
    <ul className="list-group">
      <li className="list-group-item">
        <input type="checkbox" id="facebook" />
        <label for="facebook"> facebook</label>
      </li>
    </ul>
  );
}
export default ListItem;
